#!/usr/bin/env python3# -*- coding: utf-8 -*-"""Created on Fri Jan 12 13:55:38 2024NASDAQ Itch Sample Data@author: clemmie"""from Utils import FileUtils as fufrom pathlib import Pathfrom urllib.parse import urljoinimport shutilimport gzipfrom Data.Interface import *class NASDAQITCHSampleDataSource(StaticDataSourceInterface.StaticDataSourceInterface):        def getData(self):        ##Download the file        target_path = Path("../Resources")        url = urljoin('https://emi.nasdaq.com/ITCH/Nasdaq%20ITCH/','07302019.NASDAQ_ITCH50.gz')        fu.download_if_not_exist(url=url,target_path=target_path)                #Process the file        filename = target_path /  url.split('/')[-1]        unzipped = target_path / (filename.stem + '.bin')        if not unzipped.exists():            print('Unzipping to', unzipped)            with gzip.open(str(filename), 'rb') as f_in:                with open(unzipped, 'wb') as f_out:                    shutil.copyfileobj(f_in, f_out)                return unzippedif __name__ == '__main__':    NASDAQITCHSampleDataSource.getData()